import React from "react"

function LogementDetails(props) {

    return (
        <div>
            <h1 id="logement__title">
                {props.data.title}
            </h1>
            <p>
                {props.data.location}
            </p>
            <div>
                {props.data.tags.map((tag) => {
                    <h1>
                        {tag}
                    </h1>
                })}
                </div>
            <div id="host">
                <p>
                    {props.data.host.name}
                </p>
                <img src={props.data.host.picture} alt="Host" />
            </div>
        </div>
    )
}

export default LogementDetails
